import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-card">
        <h1 className="home-title">Hoşgeldiniz!</h1>
        <p className="home-message">
          MentUp platformuna hoş geldiniz! Daha fazlası için lütfen giriş yapın ya da kayıt olun.
        </p>
      </div>
    </div>
  );
};

export default Home;
